sys_variable_value.value:
(function execute(inputs, outputs) {

    if (!inputs.drive || inputs.drive.trim() == "")
        throw "Drive ID cannot be empty or null.";
    outputs.driveid = inputs.drive.trim();

    if (!inputs.workbook || inputs.workbook.trim() == "")
        throw "Workbook ID cannot be empty or null.";
    outputs.workbookid = inputs.workbook.trim();

    if (!inputs.worksheet || inputs.worksheet.trim() == "")
        throw "Worksheet Name cannot be empty or null.";

    if (!inputs.table || inputs.table.trim() == "")
        throw "Table Name cannot be empty or null.";
    try {
        if (typeof(inputs.connection) == "object")
            outputs.alias_sys_id = inputs.connection.sys_id;
        else
            outputs.alias_sys_id = (JSON.parse(inputs.connection)).value;
    } catch (ex) {
        outputs.alias_sys_id = inputs.connection;
    }
    var request_body = {};
    var handler = new MicrosoftExcelErrorHandler();
    try {

      if (inputs.values && handler.isNotEmptyArray(inputs.values)) 
        request_body["values"] = handler.constructArrayofArrays(inputs.values);
    } catch (ex) {
        if (inputs.values && handler.isNotEmptyArray(inputs.values))
            request_body["values"] = inputs.values;
    }
    if (inputs.index)
        request_body.index = parseInt(inputs.index);
    outputs.resourcepath_add_row = "workbook/worksheets/" + inputs.worksheet.trim() + "/tables/" + inputs.table.trim() + "/rows/add";
  //re-arrange to match MS format

  var newlist = [];
  var outlist = [];
  var newObj = {};
  newlist = inputs.values;
  outlist.push(newlist)
  newObj.values= outlist;

    outputs.requestbody = JSON.stringify(newObj);
  //outputs.requestbody = '{"values":[[1,2,3,4]]};
})(inputs, outputs);

